import React from 'react';
import Container from 'react-bootstrap/Container';

function BlogPost() {
    return (
        <Container fluid={false}>
            <h4>BlogPostTitle</h4>
            <p>BlogPostContent</p>
        </Container>
    );
}

export default BlogPost;
